import React from 'react'

const Task = ({task}) => {
    return (
        <div>
            <li><p>{task.name}</p></li>

            <div className="state">
                {
                task.state 
                ?
                (
                    <button>Completed</button>
                )
                :
                (
                    <button>Incompleted</button>
                )
            
            }
            </div>
        </div>
    )
}

export default Task
